import React, { Component } from 'react'
import {Table} from 'react-bootstrap';




export  class Categorie extends React.Component {

    constructor(props){
        super(props);

        this.state={
            produits:[]
        };
    }

    componentDidMount(){
        const ob = {
            X: 53.0331258,
            Y: 18.7155611,
          }
       fetch("https://localhost:44318/api/produits",).then(res=>res.json()).then(
           result=>{
               this.setState({produits:result});
           }
       )
    }

    render() {
        return (
        <Table className="mt-4" striped bordered hover size="sm">
            <thead>
                <tr>
                    <th>id</th>
                    <th>Name</th>
                    <th>prix</th>
                </tr>
            </thead>
             <tbody>
                {this.state.produits.map(Produit=>
                    <tr key={Produit.Id}>
                        <td>{Produit.Id}</td>
                        <td>{Produit.NameProduit}</td>
                        <td>{Produit.PrixProduit}</td>
                   </tr>
                )}
            </tbody>                
        </Table>
        )
    }
}
export default Categorie
